import ReactDOM from "react-dom";
import React from "react";
import "./Index.css";
import App from "./App";
import { BrowserRouter } from "react-router-dom";

ReactDOM.render(
    <>
    <BrowserRouter>
     <App/>
    </BrowserRouter>
    </>
, document.getElementById("root"));
